import ReactDOM from 'react-dom'
import { UserSignUp } from '../../services/authentication/authentication'

const SignUp = () => {
    let email;
    let password;
    let rePassword;

    const HandleSubmit = () => {
        const data = {
            email: this.email,
            password: this.password,
            rePassword: this.rePassword
        }
        UserSignUp(data).then((response) => {
            if (response.status === "error") {
                console.log('error')
            }
            else {
                console.log('success')
            }
        })
        .catch((error) => {
            console.log(error)
        })
    }

    let content = (
        <div>
            <h3>Sign up</h3>
            <div>
                <form action="">
                    <label for="email">Email</label>
                    <input type="text" ref={(input) => this.email = input} name="uemail" />
                    <label for="password">Password</label>
                    <input type="password" ref={(input) => this.password = input} name="upassword" />
                    <label for="password">Retype password</label>
                    <input type="password" ref={(input) => this.rePassword = input} name="urepassword" />
                    <input type="submit" value="Sign up" />
                </form>
            </div>
        </div>
    );
    return content;
}

export default SignUp
